import { createGlobalStyle } from 'styled-components';

 const Global = createGlobalStyle`
  * {
    margin: 0;
    padding: 0;
    list-style: none;
    font-family: sans-serif;  
    font-family: 'Raleway', sans-serif;
  }
`;

export default Global;
